import org.testng.annotations.DataProvider;
import org.testng.annotations.Test;

import java.util.List;

import static org.testng.Assert.assertEquals;
import static org.testng.Assert.assertTrue;

public class AllAnagramsInAStringTest {

    @DataProvider(name = "testData")
    public Object[][] createDataObject() {
        return new Object[][]{
                {"cbaebabacd", "abc", List.of(0,6)    }, //[example1] first entry at 0, no overlap
                {"abab",       "ab",  List.of(0,1,2)  }, //[example2] overlapping anagrams
                {"a",          "a",   List.of(0)      }, //minimal length, left most symbol is an anagram
                {"a",          "b",   List.of()       }, //minimal length, no match
                {"a",          "aa",  List.of()       }, //impossible match - empty list, instead of out of bounds error
                {"az",         "z",   List.of(1)      }, //right most symbol is an anagram
                {"aaaaa",      "aa",  List.of(0,1,2,3)}, //repeating symbols
                {"caca",       "cac", List.of(0)      }, //repeating symbols, unbalanced quantities
                {"abaacbabc",  "abc", List.of(3,4,6)  }, //overlapping with break of pattern inside
                {"",
                               "",
                                      List.of(0,10001)}  //big numbers
        };
    }

    @Test(dataProvider = "testData")
    public void testSolution(String s, String p, List<Integer> indices) {
        List<Integer> result = new AllAnagramsInAString().findAnagrams(s, p);

        assertEquals(result.size(), indices.size());
        assertTrue(indices.containsAll(result));
    }
}
